import data from "../db/data.json"
import Galcard2 from "./Galcard2";
import "./Gal.css";

const GalSelect = () => {

    const items  = data.response.body.items.item ;
    const item= {
        WebImageUrl : 'https://s.pstatic.net/dthumb.phinf/?src=%22https%3A%2F%2Fs.pstatic.net%2Ftvcast.phinf%2F20230208_147%2FFdj7s_1675858292303snwVW_JPEG%2F20230208_210103_254_1.jpg%22&type=nf464_260',
        Title : "사랑의 이해" ,
        Month : '202302',
        photographer: "jtbc",
        searchkeyword : "비밀을 알게된 문가영"
    }


    return (
        <>
            <Galcard2 cardItem={item}/>
           
            
            
        </>
    );
}
export default GalSelect ;
